Pregnancy is supposed to be wonderful, but for Ndanji, finding out that she had a baby on the way became a nightmare after her boyfriend disappeared from her life and denied that he was the baby’s father.
There are various reasons that will make a father deny paternity. In most cases, fathers who deny their children have trust issues, or are simply running away from their responsibilities. Others might not be ready to be a parent and thus feel that the woman is trapping them with a baby, and the only way out for him is if he denies paternity. Some men deny paternity because they are already in committed relationships with other people.  Teenage fathers often deny their children because they fear telling their families.
